// CORRECT: Clear errno before call
errno = 0;
long data = ptrace(PTRACE_PEEKDATA, pid, addr, NULL);

// Double-gated check
if (data == -1 && errno != 0) {
perror("ptrace"); // Actual kernel error (e.g. EIO)
return -1;
}
